/* eslint-disable no-undef */
/* eslint-disable react/prop-types */
import React from "react";
import { Testimonials } from "../dataProduct/dataProduct";
import { Badge } from "react-bootstrap";
// import { Badge } from "react-bootstrap";


const Testimonialbadge = () => {
  return (
    <section className="badgeE">
      {Testimonials.map((i , testimonial) => (
        <div className="" key={i}>
          <div  className="hg">
            {testimonial.badGe > 0 && (
              <Badge>{testimonial.BadGe}</Badge>
            )}
          </div>
        </div>

      ))}
    </section>
  );
};

export default Testimonialbadge;
